import React from "react";
import styled from "styled-components";

const Rocket = styled.div`
  text-align: center;
  img {
    width: 630px;
  }
`;

function Index() {
    return (
        <Rocket>
            <img alt="image" src="https://media.giphy.com/media/QbumCX9HFFDQA/giphy.gif" />
        </Rocket>
    );
}

export default Index;
